Sentence withheld. Defendant is placed on probation to DOC for four (4) years.
Conditions of probation are:
1)	Assessment/treatment/counseling as deemed appropriate by the Departments assessment process;
2)	Comply with all rules for a sex offender;
3)	No possession of any internet enabled device without the agents approval;
4)	No use of the internet without agents approval;
5)	Maintain full time employment and/or work search;
6)	No contact with any minors except incidental contact with the exception of A.N. who is 7 and A.B. who is 3 unless more are approved by agent;
7)	Twelve (12) months jail; ten (10) months up front, under the Huber Law including child care, commencing 02-14-2018 by 5:00 p.m., two (2) months jail, imposed and stayed, to be imposed upon the agents discretion and by further order of the court. The defendant is permitted to travel out of the county for work.
8)	Pay court costs;
9)	Pay supervision fees in an amount to be determined by DOC;
10)	Submit to a DNA sample.
The court reminds the defendant that if he were to be revoked he will be sent to prison.  
The defendant has 3 days credit if revoked. 
$500.00 cash bail shall be applied to the court costs. 
Minutes.
